import React from "react";
import CardCours from "../components/CardCours";

import Navbar from "../components/navbar";

class DeuxiemeAcCours extends React.Component {
  render() {
    return (
      <div>
        <Navbar />
        <CardCours />
      </div>
    );
  }
}

export default DeuxiemeAcCours;
